import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

function tick() {
  root.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>
  );
}  

setInterval(tick,1000);
